Mô_tả_chi_tiết:
- Chính chủ cần bán AB 2008 còn tốt - 49.000km.
- Chuyển nhượng công chứng HĐMB, giấy tờ đầy đủ;
- Xem xe Quận 7 - Chung cư The Golden Star.

- Xe biển số Đà Lạt, mua qua uỷ quyền;
- Xe bảo trì bảo dưỡng và thay nhớt định kỳ;
- Do ít đi nên cần bán.

Xe mẹ mình mua và đi từ 2010 đến nay là 3 vạn 6 km. Động cơ zin 100%, nổ máy cái cảm nhận được liền. Xe biển 99-… Bắc Bling, giấy tờ chính chủ. 
- Màu xe: Đỏ bạc đen;
- Vành đúc màu đen;
- Năm sản xuất: 2010;
- Tiêu tốn nhiên liệu: 2 lit/100 km
- Ai có ý định mua Wave, Sirius đời mới hoặc Suzuki, Jupiter đời cũ gặp xe mình đều phải suy nghĩ lại. Xe tăng tốc êm ái, mượt mà, cảm giác lái đầm chắc tự tin. Kiểu dáng xe thì theo mình là đẹp trong tất cả các đời xe Future.

- Chỉnh chủ dư xe nên bán;
- xe chạy tốt, mã còn ngon, ít tốn xăng;
- không tai nạn, va quẹt; chỉ *** một đời chủ
- biển số đăk lăk
- cà vẹt đứng tên chính chủ. 
Phù hợp sinh viên, người lao động mua lại sử dụng rất bền, tiết kiệm xăng.
